// 对于antd 5+版本
import 'antd/dist/reset.css';

// 或者完全移除CSS导入，改为在index.js中全局引入
import 'antd/dist/antd.min.css';
import React from 'react';
import { Select, Button } from 'antd';

const NavBar = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '16px' }}>
      <div>
        <Select defaultValue="年" style={{ width: 80 }}>
          <Select.Option value="年">年</Select.Option>
        </Select>
        <Select defaultValue="月" style={{ width: 80, marginLeft: 8 }}>
          <Select.Option value="月">月</Select.Option>
        </Select>
        <span style={{ margin: '0 8px' }}>第</span>
        <Select defaultValue="阶段" style={{ width: 100 }}>
          <Select.Option value="阶段">阶段</Select.Option>
        </Select>
        <span style={{ marginLeft: 8 }}>项目交付及产品研发计划</span>
      </div>
      <Button type="primary">增加计划</Button>
    </div>
  );
};

export default NavBar;
